// src/components/Experience.js
import React from "react";

function TechStack() {
  return (
    <div className="techStack">
      <h1>
        TECH STACK <span style="font-size: 14px;">&lt;/&gt;</span>
      </h1>
      <ul>
        <li>Software Developer at XYZ Corp — Jan 2020 - Present</li>
        <li>Junior Developer at ABC Inc — Aug 2018 - Dec 2019</li>
      </ul>
    </div>
  );
}

export default TechStack;
